import React from "react";
import { Oval } from "react-loader-spinner";
const Spinner = () => {
  return (
    <Oval
      height={24}
      width={24}
      color="white"
      wrapperStyle={{}}
      wrapperClass=""
      visible={true}
      ariaLabel="oval-loading"
      secondaryColor="#4fa94d"
      strokeWidth={2}
      strokeWidthSecondary={2}
    />
  );
};
export default Spinner;
